(2214,'<p>XMLHttpRequest对象的readyState属性用来描述当前对象的状态.其中__________表示UNSENT(未发送),对象被创建,但尚未调用open()方法;_______________表示HEADERS_ RECEIVED(接收到请求头)，send()方法已经被调用，并且头部和状态已经可获得;_____表示 LOADING(正在下载响应体)，下载中，responseText属性已经包含部分数据;____表示 OPENED(初始化与服务端连接)，open()方法已经被调用;__表示DONE(下载响应体完成)，下载操作已完成.</p><p class=\"ql-align-justify\"><br></p>',1,379,1,'2021-11-14 01:13:00',NULL,99,'0'),

