(2438,'<p>已知在硬盘: F:\\\\4.txt&nbsp;文件中保存字符串数据：</p><p>尚硅谷</p><p>尚硅谷程序员</p><p>硅谷大厂</p><p>硅谷学院</p><p>&nbsp;</p><p>注意：</p><p>1)该文件以GBK编码保存的。</p><p>2)idea工作环境默认编码方式是UTF-8。</p><p>观察下列代码，以下说法正确的是：(&nbsp;&nbsp;)</p><p>&nbsp;</p><p>InputStreamReader isr = new InputStreamReader(new FileInputStream(\"F:\\\\4.txt\"),\"GBK\");</p><p>OutputStreamWriter w = new OutputStreamWriter(new FileOutputStream(\"F:\\\\3.txt\"),\"utf8\");</p><p>char[] buffer = new char[1024];</p><p>int len = -1;</p><p>while((len = isr.read(buffer)) != -1){w.write(buffer, 0, len);}</p><p>isr.close();</p><p>w.close();</p>',1,39,1,'2021-11-14 01:13:00',NULL,99,'0'),

(2439,'<p>已知在项目的模块atguigu下存在一个文件person.txt，里面的内容如下：</p><p>&nbsp;</p><p>王五=南京</p><p>张三=上海</p><p>李四=北京</p><p>&nbsp;</p><p>观察下列代码，最终结果是：(&nbsp;&nbsp;)</p><p>Properties prop = new Properties();</p><p>prop.load(new FileReader(\"atguigu\\\\person.txt\"));</p><p>Set&lt;String&gt; keys = prop.stringPropertyNames();</p><p>for (Iterator&lt;String&gt; it = keys.iterator(); it.hasNext();) {</p><p>String key = it.next();</p><p>String value = prop.getProperty(key);</p><p>System.out.println(key+\"---\"+value);</p><p>}</p>',1,39,1,'2021-11-14 01:13:00',NULL,99,'0'),

(2440,'<p>已知存在一个文件：D:\\user.txt，里面的内容如下：</p><p>username=zhangsan</p><p>password=123</p><p>观察下列代码，最终结果是：(&nbsp;&nbsp;)</p><p>Properties prop = new Properties();</p><p>prop.load(new FileReader(\"D:\\\\user.txt\"));</p><p>String username = prop.getProperty(\"username\");</p><p>String password = prop.getProperty(\"password\");</p><p>if(\"zhangsan\".equals(username)&amp;&amp;\"123\".equals(password)){System.out.println(\"登录成功\");}else{System.out.println(\"用户名或者密码错误\");}</p>',1,39,1,'2021-11-14 01:13:00',NULL,99,'0'),

(2441,'<p>观察下列代码，最终结果是：(&nbsp;&nbsp;)</p><p>客户端代码：</p><p>Socket s = new Socket(\"127.0.0.1\", 10000);</p><p>OutputStream os = s.getOutputStream();</p><p>os.write(\"hello，TCP,我来了\".getBytes());</p><p>s.close();</p><p><br></p><p>服务端代码：</p><p>&nbsp;</p><p>ServerSocket serverSocket = new ServerSocket(9999);</p><p>Socket socket = serverSocket.accept();</p><p>InputStream is = socket.getInputStream();</p><p>byte[] buf=new byte[1024];</p><p>int len=0;</p><p>while((len=is.read(buf))!=-1){System.out.println(new String(buf,0,len));}</p>',1,39,1,'2021-11-14 01:13:00',NULL,99,'0'),

