(5832,'\"Copy阶段：ReduceTask从各个MapTask上远程拷贝一片数据，并针对某一片数据，如果其大小超过一定阈值，则写到磁盘上，否则直接放到内存中。\"',1788,'0','2021-10-19 23:40:40',NULL,'0'),

(5833,'\"Combine阶段：当所有数据处理完成后，ReduceTask对所有临时文件进行一次合并，以确保最终只会生成一个数据文件。\"',1788,'1','2021-10-19 23:40:40',NULL,'0'),

(5834,'\"Sort阶段：按照MapReduce语义，用户编写reduce()函数输入数据是按key进行聚集的一组数据。为了将key相同的数据聚在一起，Hadoop采用了基于排序的策略。由于各个MapTask已经实现对自己的处理结果进行了局部排序，因此，ReduceTask只需对所有数据进行一次归并排序即可。\"',1788,'0','2021-10-19 23:40:40',NULL,'0'),

(5835,'\"Reduce阶段：reduce()函数将计算结果写到HDFS上。\"',1788,'0','2021-10-19 23:40:40',NULL,'0'),

(5836,'\"OutputFormat是MapReduce输出的基类\"',1789,'1','2021-10-19 23:40:40',NULL,'0'),

(5837,'\"所有实现MapReduce输出都实现了OutputFormat接口\"',1789,'1','2021-10-19 23:40:40',NULL,'0'),

(5838,'\"TextOutputFormat是默认的输出格式，它把每条记录写为文本行。它的键和值可以是任意类型，因为TextOutputFormat调用toString（）方法把它们转换为字符串。\\n\"',1789,'1','2021-10-19 23:40:40',NULL,'0'),

(5839,'\"SequenceFileOutputF输出作为后续MapRedue任务的输入，这便是一种好的输出格式，因为它的格式紧凑，很容易被压缩。\\n\"',1789,'1','2021-10-19 23:40:40',NULL,'0'),

(5840,'\"在数据采集的时候，就将小文件或小批数据合成大文件再上传HDFS。\"',1790,'1','2021-10-19 23:40:40',NULL,'0'),

(5841,'\"在业务处理之前，在HDFS上使用MapReduce程序对小文件进行合并。\"',1790,'1','2021-10-19 23:40:40',NULL,'0'),

(5842,'\"在MapReduce处理时，可采用CombineTextInputFormat提高效率。\"',1790,'1','2021-10-19 23:40:40',NULL,'0'),

